import Image1 from '../images/earbudsadd.png'
import Image2 from '../images/infinixadd.png'
import Image3 from '../images/iphonadd.png'
import Image4 from '../images/macbookadd.png'
import Image5 from '../images/samsungadd.png'


const Items = [
    {
        id:1,
        image:{Image1}
    },
    {
        id:2,
        image:{Image2}
    },
    {
        id:3,
        image:{Image3}
    },
    {
        id:4,
        image:{Image4}
    },
    {
        id:5,
        image:{Image5}
    },
]

export default Items;
